import logo from './logo.svg';
import './App.css';

const blockRand = [
  {
    color: 'black',
    position: 'col-6'
  },
  {
    color: 'red',
    position: 'col-6'
  },
  {
    color: 'grey',
    position: 'col-6'
  },
  {
    color: 'green',
    position: 'col-6'
  }
]

function App() {
  return (
    <div className="App">
      <div className="row">
        { blockRand.map((b) => {
          <div className={b.color + ' ' + b.position}></div>
        })}
      </div>
      </div>
  );
}

export default App;
